  const [modalVisible, setModalVisible] = useState(true)
  return (
    <Modal
      visible={modalVisible}
      animationType="slide"
      transparent={false}
    >

    </Modal>
  )
}

const Box = styled.View`
  width: 200px;
  height: 200px;
  background-color: #ff0000;
`
